import React from "react";
import "./footer.scss";

/**
 * footer component
 */
class Footer extends React.Component {
  render() {
    return (
      <footer>
        <section>
          <p>&copy; Can-U 2020</p>
        </section>
      </footer>
    );
  }
}

export default Footer;
